<?phpnamespace Nemundo\WebLog\Data\BrowserAgent;class BrowserAgentPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var BrowserAgentModel*/public $model;public function __construct() {parent::__construct();$this->model = new BrowserAgentModel();}/*** @return BrowserAgentRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new BrowserAgentRow($dataRow, $this->model);$list[] = $row;}return $list;}}